const delay = (ms) => new Promise((resolve) => setTimeout(resolve, ms))

function beep() {
  // https://stackoverflow.com/questions/879152/how-do-i-make-javascript-beep
  const snd1 = new Audio("data:audio/mpeg;base64,")
  snd1.play()
}

class View {
  constructor() {
    this.running = true
    this.table = document.createElement('table')
    this.table.style = 'width: 100%; border: 1px solid #EEE;'
    this.outputs = document.getElementById('outputs')
    this.outputs.appendChild(this.table)
  }

  drawTable (resultsArr) {
    // Clean up
    this.table.innerHTML = ''
    // Draw table
    resultsArr.forEach((x, i) => {
      const row = document.createElement('tr')
      const col1 = document.createElement('td')
      col1.innerHTML = x[0]
      const col2 = document.createElement('td')
      col2.style = 'position: relative; font-size: 12px;'
      col2.innerHTML = x[1]
      const bar = document.createElement('div')
      bar.style = `width: ${Math.round(x[1])}%; background-color: rgba(10, 20, 250, 0.1); height: 20px; position: absolute; top: 0; left: 0;`
      col2.appendChild(bar)
      row.appendChild(col1)
      row.appendChild(col2)
      this.table.appendChild(row)
    })
  }

  async run (data, app) {
    if (data.caller === 'run') {
      console.log('Results:', data)
      const classesArr  = data.classes.split(',').map(s => s.trim())
      const resultsArr = classesArr.map((x, i) => [x, data.logits[i]])
      // Sort by logits
      resultsArr.sort((a, b) => b[1] - a[1])
      this.drawTable(resultsArr)
      if (data.detect.trim() === resultsArr[0][0]) {
        beep()
      }
    }
  }
}